    __webpack_exports__["default"] = "<div class=\"infoContainer\">\n    <div class=\"articleHeader\" fxLayout=\"column\" fxLayoutAlign=\"center center\">\n        <div class=\"articleHeaderOverlay\">\n            <h2 class=\"fadeInDown\">Information on Corvid-19</h2>\n            <div style=\"display: none;\">\n                <div class=\"lds-ripple\">\n                    <div></div>\n                    <div></div>\n                </div>\n            </div>\n        </div>\n    </div>\n\n    <!-- <div class=\"casesTitle\" fxLayout=\"row wrap\" style=\"text-align: center;\" *ngIf=\"cases\">\n        <div fxLayout=\"column wrap\" fxFlex=\"1\">\n            <h2>Global</h2>\n            <p>Number of Reported Cases</p>\n        </div>\n        <div fxLayout=\"column wrap\"  fxFlex=\"1\">\n            <div class=\"caseNumber\">{{cases.cases}}</div>\n            <p>Number of Deaths: </p>\n            <p>Number of Deaths: {{cases.recovered}}</p>\n        </div>\n    </div> -->\n    <div fxLayout=\"row wrap\" style=\"display: flex; flex-wrap: wrap; justify-content: center;\" class=\"numbers\" fxFlex=\"100\">\n        <div fxFlex=\"50\" fxLayout=\"column wrap\" class=\"numberCard\"> \n            <p>Global Cases</p>\n            <h1>{{cases.cases}}</h1>\n        </div>\n        <div fxLayout=\"column wrap\" fxFlex=\"50\"  class=\"numberCard\">\n            <p>Recoveries</p>\n            <h2>{{cases.recovered}}</h2>\n        </div>\n        <div fxLayout=\"column wrap\" fxFlex=\"50\"  class=\"numberCard\">\n            <p>Deaths</p>\n            <h2>{{cases.deaths}}</h2>\n        </div>\n\n    </div>\n    <mat-accordion>\n        <mat-expansion-panel>\n          <mat-expansion-panel-header>\n            <mat-panel-title>\n                What is Corvid-19?\n            </mat-panel-title>\n          </mat-expansion-panel-header>\n      \n          <p>Coronavirus disease (COVID-19) is an infectious disease caused by a new virus.\n            The disease causes respiratory illness (like the flu) with symptoms such as a cough, fever, and in more\n            severe cases, difficulty breathing. You can protect yourself by washing your hands frequently, avoiding\n            touching your face, and avoiding close contact (1 meter or 3 feet) with people who are unwell.</p>\n\n        </mat-expansion-panel>\n\n        <mat-expansion-panel>\n            <mat-expansion-panel-header>\n              <mat-panel-title>\n                Symptoms\n              </mat-panel-title>\n            </mat-expansion-panel-header>\n        \n            <p>People may be sick with the virus for 1 to 14 days before developing symptoms. The most common symptoms\n                of coronavirus disease (COVID-19) are fever, tiredness, and dry cough. Most people (about 80%) recover\n                from the disease without needing special treatment.\n            </p>\n            <p>\n                More rarely, the disease can be serious and even fatal. Older people, and people with other medical\n                conditions (such as asthma, diabetes, or heart disease), may be more vulnerable to becoming severely\n                ill.\n            </p>\n            <p>\n                People may experience:\n            </p>\n            <ul>\n                <li>cough</li>\n                <li>fever</li>\n                <li>tiredness</li>\n                <li>difficulty breathing (severe cases)</li>\n            </ul>\n          </mat-expansion-panel>\n\n          <mat-expansion-panel>\n            <mat-expansion-panel-header>\n              <mat-panel-title>\n                  Prevention\n              </mat-panel-title>\n            </mat-expansion-panel-header>\n            \n            <div *ngFor=\"let item of prevention\">\n                <h4>{{item.title}}</h4>\n                <p>{{item.action}}</p>\n                <p><strong>Reason: </strong> {{item.reason}}</p>\n            </div>\n  \n          </mat-expansion-panel>\n<!-- \n          <mat-expansion-panel>\n            <mat-expansion-panel-header>\n              <mat-panel-title>\n                  Videos\n              </mat-panel-title>\n            </mat-expansion-panel-header>\n        \n  \n          </mat-expansion-panel> -->\n\n          <mat-expansion-panel>\n            <mat-expansion-panel-header>\n              <mat-panel-title>\n                  Links\n              </mat-panel-title>\n            </mat-expansion-panel-header>\n        \n            <a href=\"http://www.nicd.ac.za/\" target=\"_blank\">National Institute of Communicable Diseases</a><br>\n            <a href=\"https://www.who.int/emergencies/diseases/novel-coronavirus-2019\" target=\"_blank\">World Health Organisation</a>\n          </mat-expansion-panel>\n\n\n          \n    </mat-accordion>\n\n    \n\n</div>";
